import React from 'react';
import logo from './logo.svg';
import './App.css';

type AppState = {
  message : string;
};

class App extends React.Component<{}, AppState> {
  state: AppState = {
    message: 'Default message',
  };

  render() {
    return (
      <div>
        {this.state.message}
      </div>
    );
  }
}

export default App;
